加工品をしっかり固定して正確な位置決めが出来るクロススライドバイス
  使い易くより正確な位置決めが出来るバイスです。
  縦方向にも横方向にも送りハンドルを回して自由に動かせるので
  ドリルの穴開け作業や切削加工時のパーツの固定に便利なバイスです
  ボール盤のテーブル部にこちらを取り付けていただければ、ボール盤が簡易フライス盤や、簡易旋盤に
  変身します！
　面研磨や、旋盤っぽい加工、長穴加工、精密な穴あけ、部品製作など加工の幅がぐっと増えると
  思います。
  一般的なクロスバイスと異なり、縦横共に送りがダイヤル式で微調整が可能な為、スライドテーブル的な使用が
  出来ます。

　
